const selectors = {
  searchResults: '.search-results'
};
const fuseOptions = {
  tokenize: true,
  matchAllTokens: true,
  includeMatches: true,
  shouldSort: true,
  threshold: 0,
  location: 0,
  distance: 0,
  maxPatternLength: 32,
  minMatchCharLength: 1,
  keys: ['code', 'name', 'provinces.name']
};
const zones = [];
window.Shopify.shippingData[window.theme.helpers.deliveryId].shipping_zones.forEach(zone => {
  if (zone.name !== 'ISLANDS') {
    zone.countries.forEach(country => {
      country.shippingPrices = zone.price_based_shipping_rates;
      country.zone = zone.name;
      zones.push(country);
    });
  }
});
this.zones = zones;
const fuse = new Fuse(this.zones, fuseOptions);

const searchAnomolies = term => {
  let searchTerm = term.toLowerCase();

  if (searchTerm === 'england' || searchTerm === 'scotland' || searchTerm === 'wales') {
    return 'united kingdom';
  }

  if (searchTerm === 'northern ireland') {
    return 'ireland';
  }

  if (searchTerm === 'usa' || searchTerm === 'us') {
    return 'united states';
  }

  return term;
};

const storeLocation = () => {
  const storeLocation = window.location.host.replace('.mous.co', '');
  let storeName;

  switch (storeLocation) {
    case 'dev':
      storeName = 'DEV';
      break;

    case 'www':
      storeName = 'US';
      break;

    case 'uk':
      storeName = 'UK';
      break;

    case 'eu':
      storeName = 'EU';
      break;

    case 'fr':
      storeName = 'FR';
      break;

    case 'es':
      storeName = 'ES';
      break;

    case 'row':
      storeName = 'ROW';
      break;

    default:
      storeName = 'US';
  }

  return storeName;
};

var app = new Vue({
  // eslint-disable-line
  el: '#app',
  data: {
    inputVal: '',
    zones,
    results: [],
    attempts: 0,
    currencyFallback: window.theme.shopCurrency !== true ? window.theme.shopCurrency : '',
    storeLocation: storeLocation(),
    noResultsText: window.theme.strings.deliveryPage.noResults
  },
  delimiters: ['<%', '%>'],
  methods: {
    search() {
      this.inputVal = searchAnomolies(this.$refs.inputVal.value);
      this.results = fuse.search(this.inputVal);
      this.attempts++;
      document.querySelector(selectors.searchResults).classList.add('show');
    },

    quickSearch(searchTerm) {
      this.inputVal = searchAnomolies(searchTerm);
      this.results = fuse.search(this.inputVal);
      this.attempts++;
      document.querySelector(selectors.searchResults).classList.add('show');
    },

    addTrailingZeros(num) {
      return (Math.round(num * 100) / 100).toFixed(2);
    }

  },
  mounted: () => {
    document.querySelector(selectors.searchResults).classList.add('show');
  }
});